    return (<div>
        <Cover src="https://static.yancey.app/blog-fe-static/blog_page_header.jpg">
            <Title>Tech and Poems.</Title>
        </Cover>
        <Content>
            <CardList />
            <Aside>
                <Union icon={topIcon} title="Top 7 Most Viewed">
                    <BgComp title="Webp" url="https://yanceyleo.com/post/7891c3aa-c292-4a3a-9e34-9434d69fe21d" src="https://static.yancey.app/44299297_s.jpg?x-oss-process=image/format,webp"/>
                </Union> 
            </Aside>
        </Content>
    </div>)
}

export default Blog;
